import {analytics_data} from '../Sachet.js'
import React from 'react';


const analytics_style={
    display:"grid",
    gridTemplateColumns:"repeat(2,1fr)",
    gridTemplateRows:"repeat("+analytics_data.length/2+",1fr)",
    gridColumn:"1",
    gridRow:"1",
    height:"95%",
    width:"100%"
  }

  
function Alphabet_analytics(){
    
    return(<div className="analytics_container" style={analytics_style}>
        {analytics_data.map((alphabet_data)=>(
            <div className="remainder_holder">{alphabet_data.alphabet} - {alphabet_data.num}</div>
        ))}
    </div>)
}

export default Alphabet_analytics
